import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import EventCreate from './components/ClassComponents/EventCreate';
import EventList from './components/FunctionalComponents/EventList';
import EventDetails from './components/FunctionalComponents/EventDetails';
import { EventProvider } from './context/EventContext';
import './App.css';

function App() {
  return (
    <EventProvider>
      <Router>
        <div className="app">
          <nav className="navbar">
            <div className="nav-brand">Event Management System</div>
            <ul className="nav-links">
              <li><Link to="/">Home</Link></li>
              <li><Link to="/create">Create Event</Link></li>
              <li><Link to="/events">Browse Events</Link></li>
            </ul>
          </nav>

          <main className="main-content">
            <Routes>
              <Route path="/" element={<EventList />} />
              <Route path="/create" element={<EventCreate />} />
              <Route path="/events" element={<EventList />} />
              <Route path="/event/:id" element={<EventDetails />} />
            </Routes>
          </main>

          <footer className="footer">
            <p>&copy; 2024 Event Management System. All rights reserved.</p>
          </footer>
        </div>
      </Router>
    </EventProvider>
  );
}

export default App;
